import React from 'react';
import graphfarmer from './page-com/graphfarmer'

const Milk = () => {
    const divStyle = {
        margin: '16px',
        color: '#082459',
        fontSize: '24px',
        fontFamily: 'Roboto',
        fontWeight: 700,
        wordWrap: 'break-word'
    };

    return (
        <div style={divStyle}>
            กราฟแสดงปริมาณนมต่อวัน
        </div>
    );
}

export default Milk;
